  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Back Bay NWR
  outlines Refuge accomplishments from January through April of 1950. The report begins
  by summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments, plantings, and collections
  and receipts. Resource management is outlined; topics include fur harvesting. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, fishing, and violations. N-R forms and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
